@LizClaman @JoeBiden The US has no say in this and Germany does.
The EU has already asked multiple countries to supply the EU with more LNG. So we can cut off the import of oil and gas from Russia when they invade the Ukraine.
We will import the 40% LNG Russia delivers from other countries.

